    function presenter(products) {
        if(!localStorage.cart)
        {
            let cart = {
                id: 0,
                user: 0,
                products:[]
            }
            localStorage.cart = JSON.stringify(cart);
        }
        let root = document.getElementById('root');
        for(product of products){
            root.insertAdjacentHTML('beforeend',
        `<div class="item">
        <div class="img">
        <img src="${product.img}" alt="${product.name}">
        </div>
        <h1>${product.name}</h1>
        <p>${product.description}</p>
        <span>${product.price} руб.</span>
        <button id="${product.id}" onclick="addToCart(id)" type="button" >Купить</button>
        </div> `)

        
        }
        cartPresenter();
    }
    
    function  cartPresenter() {
        if(!localStorage.cart)
        {
            let cart = {
                id: 0,
                user: 0,
                products:[]
            }
            localStorage.cart = JSON.stringify(cart);
        }
        let cartElement = document.getElementById("cart");
        cartElement.remove();
        let table = document.getElementById("table")
        table.insertAdjacentHTML('beforeend', `<tbody id="cart"></tbody>`)
        cartElement = document.getElementById("cart");
        let cart = JSON.parse(localStorage.getItem ("cart"));

        for (cartProduct of cart.products)
        {
            for (product of products)
            {
                if (cartProduct.productId == product.id)
                {
                    cartElement.insertAdjacentHTML('beforeend',
                    `<tr id="cartItem">
                        <td>${product.id}</td>
                        <td><div class="img"><img src="${product.img}" alt="${product.name}"></div></td>
                        <td>${product.name}</td>
                        <td><button id="${product.id}" onclick="removeFromCart(id)" type="button" > - </button></td>
                        <td>${cartProduct.amount}</td>
                        <td><button id="${product.id}" onclick="addToCart(id)" type="button" > + </button></td>
                    </tr>
                    `)
                }
            }
        }
    }


